import { mobileAdministration } from "../../../../env/environment";
import { mobileAdministrationLogout, mobileAdministrationSelectCompany, randomStringNum, verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { MobileAdminLoginPage, MenuItemsPage, MobileAdministrationAgencyPage, MobileAdministrationCommon } from "../../../../pageobjects/mobile-administration";

describe("MOBILE ADMIN - AGENCY", () => {

    describe("NEW AGENCY TESTS", () => {

        it("Open agency page, verify page does not crash", () => {
            mobileAdministration();
            MobileAdminLoginPage.usernameInput.addValue("SuperAdmin");
            MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
            MobileAdminLoginPage.signInBtn.click();
            mobileAdministrationSelectCompany();
            MenuItemsPage.agencyMenuItem.click();
        });

        it("Open new agency page, verify page does not crash", () => {
            MobileAdministrationAgencyPage.newAgencyBtn.click();
            const centralName = $("span=HR Central");
            verifyIsVisible(centralName);
        });

        it("Select Central, verify page is opened", () => {
            MenuItemsPage.agencyMenuItem.click();
            MobileAdministrationAgencyPage.newAgencyBtn.click();
            const centralName = $("span=HR Central");
            centralName.waitForClickable();
            centralName.click();
            const agencyname = $("div=MonoQA");
            verifyIsVisible(agencyname);
            verifyIsVisible(MobileAdministrationAgencyPage.newAgency.addNewAgencyBtn);

        });

        it("Open Agency create page", () => {
            MobileAdministrationAgencyPage.newAgency.addNewAgencyBtn.waitForClickable();
            MobileAdministrationAgencyPage.newAgency.addNewAgencyBtn.click();
        });

        it("Create an agency, verify", () => {
            const randomAgencyNum = randomStringNum();
            MobileAdministrationAgencyPage.newAgency.agencyNameInput.addValue(`Automated${randomAgencyNum}`);
            MobileAdministrationAgencyPage.newAgency.agencyAddressInput.addValue('address');
            MobileAdministrationAgencyPage.selectCurrency("li=Euro (EUR)");
            /* $("[type='submit']").click();
            verifyIsVisible($("div=Agency created successfully")); */  //Remove comment if you want to create agencies
        });
    });

    describe("NEW AGENT PARTNER TESTS", () => {

        it("Open new agent partner page", () => {

            MenuItemsPage.agencyMenuItem.click();
            MobileAdministrationAgencyPage.newAgentPartnerBtn.click();
        });

        it("Create agent partner", () => {
            MobileAdministrationAgencyPage.newAgentPartner.usernameInput.addValue(`autoAgentPartner${randomStringNum()}`);
            MobileAdministrationAgencyPage.newAgentPartner.passwordInput.addValue('mono.123');
            MobileAdministrationAgencyPage.newAgentPartner.confirmPasswordInput.addValue('mono.123');
            MobileAdministrationAgencyPage.newAgentPartner.firstNameInput.addValue(randomStringNum());
            MobileAdministrationAgencyPage.newAgentPartner.lastNameInput.addValue(randomStringNum());
            const central = $('span=HR Central');
            central.click();
            const agency = $('span=MonoQA');
            agency.click();
            $("[type='submit'] .btn__label").click();
            const successToastMessage = $("div=Agency Partner created successfully");
            verifyIsVisible(successToastMessage);
            browser.pause(1000);
        });
    });

    describe("EDIT PARTNER TESTS", () => {
        it("Open Edit partner page, verify page is opened", () => {


            MenuItemsPage.agencyMenuItem.click();
            MobileAdministrationAgencyPage.editPartnerBtn.click();
            verifyIsVisible(MobileAdministrationAgencyPage.editPartner.userInput);
            verifyIsVisible(MobileAdministrationAgencyPage.editPartner.filterLabel);
            verifyIsVisible(MobileAdministrationAgencyPage.editPartner.roleDropdown);
        });

        const backButton = ".icon--nav-back--white";
        const firstFilteredResult = ".list--primary > div > div:nth-of-type(1)";

        it("Verify Agent roles are filtered", () => {
            MenuItemsPage.agencyMenuItem.click();
            MobileAdministrationAgencyPage.editPartnerBtn.click();
            MobileAdministrationAgencyPage.editPartner.selectRole('Agent');
            MobileAdministrationCommon.search();

            $(firstFilteredResult).click();

            const roleElement = $(".card--primary__body").$("div*=Agent");
            verifyIsVisible(roleElement);
            $(backButton).click();
        });

        it("Verify Shop Manager roles are filtered", () => {
            MenuItemsPage.agencyMenuItem.click();
            MobileAdministrationAgencyPage.editPartnerBtn.click();
            MobileAdministrationAgencyPage.editPartner.selectRole('Shop manager');
            MobileAdministrationCommon.search();

            $(firstFilteredResult).click();

            const roleElement = $(".card--primary__body").$("div*=Betting Shop Manager");
            verifyIsVisible(roleElement);
            $(backButton).click();
        });

        it("Verify Cashier roles are filtered", () => {
            MenuItemsPage.agencyMenuItem.click();
            MobileAdministrationAgencyPage.editPartnerBtn.click();
            MobileAdministrationAgencyPage.editPartner.selectRole('Cashier');
            MobileAdministrationCommon.search();

            $(firstFilteredResult).click();

            const roleElement = $(".card--primary__body").$("div*=Cashier");
            verifyIsVisible(roleElement);
            $(backButton).click();
        });

        it("Verify Partner roles are filtered", () => {
            MenuItemsPage.agencyMenuItem.click();
            MobileAdministrationAgencyPage.editPartnerBtn.click();
            MobileAdministrationAgencyPage.editPartner.selectRole('Partner');
            MobileAdministrationCommon.search();

            $(firstFilteredResult).click();

            const roleElement = $(".card--primary__body").$("div*=Partner");
            verifyIsVisible(roleElement);
            $(backButton).click();
        });

        it("Verify new password was generated", () => {
            MenuItemsPage.agencyMenuItem.click();
            MobileAdministrationAgencyPage.editPartnerBtn.click();
            MobileAdministrationAgencyPage.editPartner.selectRole('Partner');
            MobileAdministrationCommon.search();

            $(firstFilteredResult).click();

            MobileAdministrationAgencyPage.editPartner.resetPasswordGenerateBtn.click();
            const newPasswordLabel = $("span=New Password");
            const newPasswordBox = $(".spc--top--sml");
            verifyIsVisible(newPasswordLabel);
            verifyIsVisible(newPasswordBox);
        });

        it("Verify new password can be copied", () => {
            MenuItemsPage.agencyMenuItem.click();
            MobileAdministrationAgencyPage.editPartnerBtn.click();
            MobileAdministrationAgencyPage.editPartner.selectRole('Partner');
            MobileAdministrationCommon.search();
            $(firstFilteredResult).click();
            MobileAdministrationAgencyPage.editPartner.resetPasswordGenerateBtn.click();
            MobileAdministrationAgencyPage.editPartner.copyNewPasswordBtn.waitForClickable();
            MobileAdministrationAgencyPage.editPartner.copyNewPasswordBtn.click();
            const successfullToastMessage = $("div*=Copied text");
            verifyIsVisible(successfullToastMessage);
        });

        it("Verify activation and deactivation", () => {
            MenuItemsPage.agencyMenuItem.click();
            MobileAdministrationAgencyPage.editPartnerBtn.click();
            MobileAdministrationAgencyPage.editPartner.selectRole('Partner');
            MobileAdministrationCommon.search();
            $(firstFilteredResult).click();
            const lockedUserMessage = $("div=User locked successfully");
            const unlockedUserMessage = $("div=User unlocked successfully");
            MobileAdministrationAgencyPage.editPartner.activePartnerBtn.click();
            verifyIsVisible(lockedUserMessage);
            MobileAdministrationAgencyPage.editPartner.inactivePartnerBtn.click();
            verifyIsVisible(unlockedUserMessage);
        });
    });

    describe("DEPOSIT / WITHDRAWAL TESTS", () => {

        it("Open deposit and withdrawal page, verify page is opened", () => {

            MenuItemsPage.agencyMenuItem.click();
            MobileAdministrationAgencyPage.depositWithdrawalBtn.click();
            verifyIsVisible(MobileAdministrationAgencyPage.depositWithdrawal.roleDropdown);
            verifyIsVisible(MobileAdministrationAgencyPage.depositWithdrawal.userInput);
        });

        it("Search all users, verify results are loaded", () => {
            MobileAdministrationAgencyPage.depositWithdrawal.searchBtn.waitForClickable();
            MobileAdministrationAgencyPage.depositWithdrawal.searchBtn.click();
            verifyIsVisible($(".list--primary"));
        });

        it("Select a user, verify user page is opened", () => {
            const firstFilteredResult = ".list--primary > div > div:nth-of-type(1)";
            $(firstFilteredResult).click();
        });

        it("Deposit to account, verify request was a success", () => {
            const value20 = $(".at-numpad-20");
            const depositSuccessfullMessage = $("div=Deposit successful");
            const withdrawalSuccessfullMessage = $("div=Withdrawal successful");

            value20.waitForClickable();
            value20.click();
            MobileAdministrationAgencyPage.depositWithdrawal.depositBtn.click();
            verifyIsVisible(depositSuccessfullMessage);

            MobileAdministrationAgencyPage.depositWithdrawal.payoutBtn.waitForClickable();
            MobileAdministrationAgencyPage.depositWithdrawal.payoutBtn.click();
            verifyIsVisible(withdrawalSuccessfullMessage);
        });

    });

    describe("AGENCY MANAGEMENT TESTS", () => {

        it("Open agency management page, verify page is opened", () => {

            MenuItemsPage.agencyMenuItem.click();
            MobileAdministrationAgencyPage.agencyManagementBtn.click();
            verifyIsVisible($("div=Agency management"));
        });

        it("Open an agency, verify page is opened", () => {
            $("span=HR Central").waitForClickable();
            $("span=HR Central").click();
            $("span=MonoQA").click();

            const agencyName = $(".card--primary__body").$("div=MonoQA");
            verifyIsVisible(agencyName);
        });

        it("Activate and deactivate agencies, verify messages", () => {
            const agencyDeactivatedMessage = $("div=Agency deactivated successfully");
            const agencyActivatedMessage = $("div=Agency activated successfully");
            const displayedActiveAgencyBtn = MobileAdministrationAgencyPage.agencyManagement.activeAgencyBtn.isDisplayed();

            if (!displayedActiveAgencyBtn) {
                MobileAdministrationAgencyPage.agencyManagement.inactiveAgencyBtn.click();
            } else {
                return;
            }

            MobileAdministrationAgencyPage.agencyManagement.activeAgencyBtn.waitForClickable();
            MobileAdministrationAgencyPage.agencyManagement.activeAgencyBtn.click();
            verifyIsVisible(agencyDeactivatedMessage);
            MobileAdministrationAgencyPage.agencyManagement.inactiveAgencyBtn.waitForClickable();
            MobileAdministrationAgencyPage.agencyManagement.inactiveAgencyBtn.click();
            verifyIsVisible(agencyActivatedMessage);
        });
    });
});

