import { mobileAdministrationLogout } from "../common/Common.page";

class MobileAdministrationCommon {
    filter = {

        selectShopMenu: {
            get selectAllBtn() {
                return $("button[title='Select all']");
            },
            get clearBtn() {
                return $("button[title='Clear']");
            },

            selectCentral(central) {
                $(".rc-tree-list-holder-inner")
                    .$(`span*=${central}`).click();
            },
            selectshop(central, agency, shop) {
                const selectCentral = $(".rc-tree-list-holder-inner").$(`span*=${central}`);
                selectCentral.waitForClickable();
                selectCentral.click();

                const selectAgency = $(".rc-tree-list-holder-inner").$(`span*=${agency}`);
                selectAgency.waitForClickable();
                selectAgency.click();

                const selectShop = $(".rc-tree-list-holder-inner").$(`span*=${shop}`);
                selectShop.waitForClickable();
                selectShop.click();
            },
        },

        get filterBtn() {
            return $(".l--footer").$("button=Filter");
        },


    }
    search() {
        const searchButton = $("button[title='Search']");
        searchButton.waitForClickable();
        searchButton.click();
    }
    logoutIfLoggedIn() {
        const signInBtn = $("span=Sign In");
        const signInIsVisible = signInBtn.isDisplayed();
        if (!signInIsVisible) {
            mobileAdministrationLogout();
            browser.refresh();
        } else {
            return;
        }
    }
}

export default new MobileAdministrationCommon();

