import { expect } from "chai";
import { env } from "../../env/environment";
import { MenuItemsPage, MobileAdminLoginPage } from "../mobile-administration";

export function searchTable(value) {
  $(".treeview__search__input").addValue(value);
}

export function verifyElementValue(element, value) {
  $(element).getValue();
  let inputValue = $(element).getValue();
  expect(inputValue).to.equal(value);
}

export function waitForLoader(loader = ".k-loading-image") {
  $(loader).waitForDisplayed({ reverse: true });
}

export function verifyIsNotVisible(element) {
  element.waitForDisplayed({ reverse: true });
}

export function verifyIsVisible(element) {
  element.waitForDisplayed({ reverse: false });
}

export function randomStringNum() {
  return String(Math.random()).slice(2, -1);
}
export function mobileAdministrationSelectCompany() {
  const qa = "label=TW / HR";
  const dev = "label=ML / RootMill";
  /* MenuItemsPage.companySelectorMenuItem.click();
    $("button[title='Select']").click(); */
  const visibleCompanyBody = $(".modal__body").isDisplayed();
  const closeModalBtn = $(".icon--close");

  MenuItemsPage.companySelectorMenuItem.click();

  if (!visibleCompanyBody) {
    closeModalBtn.click();
    browser.pause(1000);
    MenuItemsPage.companySelectorMenuItem.waitForClickable();
    MenuItemsPage.companySelectorMenuItem.click();
  } else {
    return;
  }
  browser.pause(1000);
  $(qa).click();
  //browser.pause(1000);
  $("button[title='Select']").click();
}

export function mobileAdministrationLogout() {
  browser.url(`${env}.gp.m.admin.gp.develop/platform/`);
  MenuItemsPage.logOutMenuItem.click();
  //verifyIsVisible(MobileAdminLoginPage.h3Title);
}

export function mobileTwAdministrationLogout() {
  browser.url(`${env}.m.admin.gp.develop/platform/`);
  MenuItemsPage.logOutMenuItem.click();
  //verifyIsVisible(MobileAdminLoginPage.h3Title);
}

