            MobileAdministrationBetsPage.betsOverviewBtn.waitForClickable();
        });

        it("Verify all page buttons are visible", () => {
            verifyIsVisible(MobileAdministrationBetsPage.betsOverviewBtn);
            verifyIsVisible(MobileAdministrationBetsPage.cashinoOverviewBtn);
            verifyIsVisible(MobileAdministrationBetsPage.searchByIdBtn);
            verifyIsVisible(MobileAdministrationBetsPage.searchBtn);
            verifyIsVisible(MobileAdministrationBetsPage.betSlipsForPayoutBtn);
            verifyIsVisible(MobileAdministrationBetsPage.criticalBetSlipsBtn);
            verifyIsVisible(MobileAdministrationBetsPage.turnoverReportBtn);
        });

        it("Open bets overview page, filter results", () => {
            MobileAdministrationBetsPage.betsOverviewBtn.click();
            MobileAdministrationCommon.filter.selectShopMenu.selectAllBtn.click();
            MobileAdministrationCommon.filter.filterBtn.click();
            const resultheader = $(".k-grid-header");
            verifyIsVisible(resultheader);
        });

    });

    describe("CASINO OVERVIEW TESTS", () => {
        it("Open casino overview page, verify page is loaded", () => {

            MenuItemsPage.betsMenuItem.click();
            MobileAdministrationBetsPage.cashinoOverviewBtn.waitForClickable();
        });

        it("Open casino overview page, filter results", () => {
            MobileAdministrationBetsPage.cashinoOverviewBtn.click();
            MobileAdministrationCommon.filter.selectShopMenu.selectAllBtn.click();
            $("button[title='Search']").click();
            /* const resultheader = $(".k-grid-header");
            verifyIsVisible(resultheader); */
        });

    });

    describe("SEARCH BY ID TESTS", () => {
        it("Open search by id page, verify page is loaded", () => {

            MenuItemsPage.betsMenuItem.click();
            MobileAdministrationBetsPage.searchByIdBtn.waitForClickable();
        });

        it("Search for a bet slip, verify page is loaded", () => {
            MobileAdministrationBetsPage.searchByIdBtn.click();
            MobileAdministrationBetsPage.searchByID.betSlipNumberInput.addValue('3-47275');
            MobileAdministrationBetsPage.searchByID.searchBtn.doubleClick();
            const betslipHeaderInfo = $(".table__head").$("span*=3-47275");
            verifyIsVisible(betslipHeaderInfo);
        });

        it("Click the header back button, verify page is loaded", () => {
            const headerBackBtn = $(".icon--nav-back--white");
            headerBackBtn.click();
            verifyIsVisible(MobileAdministrationBetsPage.searchByID.betSlipNumberInput);
        });


    });

    describe("SEARCH TESTS", () => {
        it("Open search page, verify page is loaded", () => {

            MenuItemsPage.betsMenuItem.click();
            MobileAdministrationBetsPage.searchBtn.waitForClickable();
        });

        it("Open search bets page, verify page is loaded", () => {
            MobileAdministrationBetsPage.searchBtn.click();
            verifyIsVisible(MobileAdministrationCommon.filter.selectShopMenu.selectAllBtn);
            MobileAdministrationCommon.filter.selectShopMenu.selectAllBtn.click();
        });

    });

    describe("BET SLIPS FOR PAYOUT TESTS", () => {

        it("Open bets slips for payout page, verify page is loaded", () => {

            MenuItemsPage.betsMenuItem.click();
            MobileAdministrationBetsPage.betSlipsForPayoutBtn.waitForClickable();
        });

        it("Filter bet slips, verify items are loaded", () => {
            MobileAdministrationBetsPage.betSlipsForPayoutBtn.click();
            MobileAdministrationCommon.filter.selectShopMenu.selectAllBtn.click();
            $("button[title='Search']").click();
        });

        it("Open a result, verify page is loaded", () => {
            $("tr:nth-of-type(1) > .c-poiner.type--link").click();
            const forPayoutTitle = $(".table__head__data.type--left").$("span*=For Payout ");
            verifyIsVisible(forPayoutTitle);
        });
    });

    describe("CRITICAL BET SLIPS TESTS", () => {
        it("Open critical bets slips page, verify page is loaded", () => {

            MenuItemsPage.betsMenuItem.click();
            MobileAdministrationBetsPage.criticalBetSlipsBtn.waitForClickable();

        });

        it("Filter results, verify results are displayed", () => {
            const firstCentralChekbox = $(".rc-tree-list-holder-inner .rc-tree-treenode-switcher-close:nth-of-type(1) .rc-tree-checkbox");
            const secondCentralCheckbox = $(".rc-tree-treenode.rc-tree-treenode-leaf-last.rc-tree-treenode-switcher-close > .rc-tree-checkbox");

            MobileAdministrationBetsPage.criticalBetSlipsBtn.click();
            verifyIsVisible(MobileAdministrationCommon.filter.selectShopMenu.clearBtn)
            firstCentralChekbox.click();
            secondCentralCheckbox.click();
            $("button[title='Search']").click();
            const header = $("table > .k-grid-header")
            verifyIsVisible(header);
        });

        it("Open a result verify page is loaded", () => {
            const firstResultElement = $("tr:nth-of-type(1) > .c-poiner.type--link");
            firstResultElement.click();
            verifyIsVisible($(".dropdown--multi"));
        });
    });

    describe("TURNOVER REPORT TESTS", () => {
        it("Open turnover report page, verify page is loaded", () => {

            MenuItemsPage.betsMenuItem.click();
            MobileAdministrationBetsPage.turnoverReportBtn.waitForClickable();
        });

        it("Open tournover report page, verify page is loaded", () => {
            MobileAdministrationBetsPage.turnoverReportBtn.click();
            verifyIsVisible(MobileAdministrationCommon.filter.selectShopMenu.selectAllBtn);
        });

        it("Filter results, verify page is loaded", () => {
            MobileAdministrationCommon.filter.selectShopMenu.selectAllBtn.click();
            $("button[title='Search']").click();
            const tableHeader = $(".k-grid-header .k-header:nth-of-type(1) .k-link");
            verifyIsVisible(tableHeader);
        });
    });

});

