import { mobileAdministration, webML } from "../../../../env/environment";
import { mobileAdministrationSelectCompany, verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { MobileAdminLoginPage, MenuItemsPage, MobileAdministrationUserActivities, MobileAdministrationCommon } from "../../../../pageobjects/mobile-administration";
import { loginWebV1Page } from "../../../../pageobjects/web-v1";


describe("MOBILE ADMIN - USER ACTIVITIES", () => {
    describe("OPEN PAYOUTS TESTS", () => {
        it("Open open payouts page, verify page is loaded", () => {
            mobileAdministration();
            MobileAdminLoginPage.usernameInput.addValue("SuperAdmin");
            MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
            MobileAdminLoginPage.signInBtn.click();
            mobileAdministrationSelectCompany();
            MenuItemsPage.userActivitiesMenuItem.click();
            verifyIsVisible(MobileAdministrationUserActivities.openPayoutsBtn);
        });

        it("Filter results, verify results are loaded", () => {
            MobileAdministrationUserActivities.openPayoutsBtn.click();
            MobileAdministrationCommon.filter.selectShopMenu.selectAllBtn.click();
            MobileAdministrationCommon.search();
            verifyIsVisible(MobileAdministrationUserActivities.openPayouts.tableResults.$("td*=Vanja"));
        });


    });
    describe("ACTIVE TERMINALS TESTS", () => {

        it("Open active terminals page, verify page is loaded", () => {
            MenuItemsPage.userActivitiesMenuItem.click();
            verifyIsVisible(MobileAdministrationUserActivities.activeTerminalsBtn);
        });

        it("Filter results, verify results are loaded", () => {
            MobileAdministrationUserActivities.activeTerminalsBtn.click();
            MobileAdministrationCommon.filter.selectShopMenu.selectAllBtn.click();
            MobileAdministrationCommon.search();
            verifyIsVisible(MobileAdministrationUserActivities.openPayouts.tableResults.$("td*=Vanja"));
        });
    });

    describe("USER ACCOUNT BALANCES TESTS", () => {

        it("Open active terminals page, verify page is loaded", () => {

            MenuItemsPage.userActivitiesMenuItem.click();
            verifyIsVisible(MobileAdministrationUserActivities.userAccountBalancesBtn);
        });

        it("Filter results, verify results are loaded", () => {
            MobileAdministrationUserActivities.userAccountBalancesBtn.click();
            MobileAdministrationCommon.filter.selectShopMenu.selectAllBtn.click();
            MobileAdministrationCommon.search();
            verifyIsVisible(MobileAdministrationUserActivities.openPayouts.tableResults.$("td*=VikiQAa/vik96 (vik ik)"));
        });
    });

    describe("USER TRANSACTIONS TESTS", () => {

        it("Login to web, submit a slip", () => {
            webML();
            loginWebV1Page.usernameInput.clearValue();
            loginWebV1Page.passwordInput.clearValue();
            loginWebV1Page.usernameInput.addValue("vik69");
            loginWebV1Page.passwordInput.addValue("pass.1234");
            loginWebV1Page.signInBtn.click();
            const myBetsBtn = $(".header--primary__navigation__thumb--bets");
            expect(myBetsBtn).to.exist;
            myBetsBtn.click();
            browser.url("http://qa.webml.gp.develop/en/sports/full/event/jrJcquNKQKohfwsD0GaZ83");
            $("button=One-click bet").click();
            $("button[title='122']").click();
            browser.pause(2000);
            loginWebV1Page.logoutBtn.click();
            verifyIsVisible($("a*=Forgot your username?"));
        });

        it("Open user transactions page, verify page is loaded", () => {

            mobileAdministration();
            MobileAdministrationCommon.logoutIfLoggedIn();
            MobileAdminLoginPage.usernameInput.addValue("SuperAdmin");
            MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
            MobileAdminLoginPage.signInBtn.click();
            mobileAdministrationSelectCompany();
            MenuItemsPage.userActivitiesMenuItem.click();
            verifyIsVisible(MobileAdministrationUserActivities.userTransactionsBtn);
        });


        it("Filter results, verify results are loaded", () => {

            MobileAdministrationUserActivities.userTransactionsBtn.click();
            MobileAdministrationUserActivities.userTransactions.usernameInput.addValue('vik69');
            $("button[title='Search'] > .btn__label").click({ force: true });
            $("button[title='Search'] > .btn__label").click({ force: true });
            verifyIsVisible($("table > tbody").$("td=Vanja/vik69"));
        });
    });

    describe("DAILY USER TRANSACTION TESTS", () => {

        it("Open active terminals page, verify page is loaded", () => {
            mobileAdministration();
            MobileAdministrationCommon.logoutIfLoggedIn();
            MobileAdminLoginPage.usernameInput.addValue("SuperAdmin");
            MobileAdminLoginPage.passwordInput.addValue("B@@sicSup3rAdm1n");
            MobileAdminLoginPage.signInBtn.click();
            mobileAdministrationSelectCompany();
            MenuItemsPage.userActivitiesMenuItem.click();
            verifyIsVisible(MobileAdministrationUserActivities.dailyUserTransactionsBtn);
        });


        it("Filter results, verify results are loaded", () => {
            MobileAdministrationUserActivities.dailyUserTransactionsBtn.click();
            MobileAdministrationCommon.filter.selectShopMenu.selectAllBtn.click();
            MobileAdministrationCommon.search();
            verifyIsVisible($("table > tbody").$("td=Betting slip payment"));
        });
    });
    // TODO - https://projects.mono-software.com/issues/79005
    describe("CASH REGISTER TRANSACTION TESTS", () => {

    });
    // TODO - https://projects.mono-software.com/issues/79005
    describe("DAILY CASH REGISTER TRANSACTIONS TESTS", () => {

    });
});

